-- INSERTS para Mantenimiento.Registro → depende de Habitacion.Habitacion  

-- 1- SELECCIONAR DESDE ACA 
DECLARE @i INT = 1;

WHILE @i <= 500
BEGIN
    DECLARE @fecha_inicio DATE = DATEADD(DAY, ABS(CHECKSUM(NEWID())) % 365, '2024-01-01');
    DECLARE @duracion INT = ABS(CHECKSUM(NEWID())) % 5; -- duración entre 0 y 4 días
    DECLARE @fecha_fin DATE = DATEADD(DAY, @duracion, @fecha_inicio);

    VALUES (
        @i,
        @fecha_inicio,
        @fecha_fin,
        CONCAT('Mantenimiento preventivo habitación ', @i)
    );

    SET @i = @i + 1;
END;
-- HASTA ACA Y EJECUTAR 

-- INSERTS para Mantenimiento.Costo → depende de Mantenimiento.Registro

-- 2- SELECCIONAR DESDE ACA 
DECLARE @i INT = 1;

WHILE @i <= 500
BEGIN
    DECLARE @costo DECIMAL(10,2) = CAST(10 + (RAND(CHECKSUM(NEWID())) * 90) AS DECIMAL(10,2));

    VALUES (@i, @costo);

    SET @i = @i + 1;
END;
-- HASTA ACA Y EJECUTAR 


-- INSERTS para Tarea.Asignacion → depende de Empleado.Empleado  

-- 3- SELECCIONAR DESDE ACA 
DECLARE @i INT = 1;

WHILE @i <= 350
BEGIN
    DECLARE @fecha DATE = DATEADD(DAY, ABS(CHECKSUM(NEWID())) % 365, '2024-01-01');
    DECLARE @eval_opciones TABLE (texto NVARCHAR(100));

    DECLARE @eval NVARCHAR(100) = (SELECT texto FROM (
        SELECT texto, ROW_NUMBER() OVER (ORDER BY NEWID()) AS rn FROM @eval_opciones
    ) AS evals WHERE rn = (ABS(CHECKSUM(NEWID())) % 3) + 1);

    VALUES (
        @i,
        CONCAT('Tarea asignada al empleado ', @i),
        @fecha,
        @eval
    );

    SET @i = @i + 1;
END;
-- HASTA ACA Y EJECUTAR 

-- Tarea.Horario → depende de Tarea.Asignacion

DECLARE @i INT = 1;

WHILE @i <= 350
BEGIN
    -- Hora base entre 7:00 AM (420 minutos) y 15:00 PM (900 minutos)
    DECLARE @min_inicio INT = 420 + (ABS(CHECKSUM(NEWID())) % 480); -- 480 minutos = 8 horas
    DECLARE @duracion INT = 60 * (1 + (ABS(CHECKSUM(NEWID())) % 4)); -- entre 60 y 240 minutos

    DECLARE @hora_inicio TIME = DATEADD(MINUTE, @min_inicio, '00:00');
    DECLARE @hora_fin TIME = DATEADD(MINUTE, @duracion, @hora_inicio);

    VALUES (@i, @hora_inicio, @hora_fin);

    SET @i = @i + 1;
END;


--Inventario.Movimiento → depende de Producto.Producto y Inventario.TipoMovimiento

DECLARE @producto INT = 1;

WHILE @producto <= 20
BEGIN
    DECLARE @mov INT = 1;

    WHILE @mov <= 5
    BEGIN
        DECLARE @id_tipo INT = 1 + (ABS(CHECKSUM(NEWID())) % 6); -- 1 a 6
        DECLARE @fecha DATETIME = DATEADD(DAY, ABS(CHECKSUM(NEWID())) % 365, '2024-01-01');
        DECLARE @cantidad INT = 1 + (ABS(CHECKSUM(NEWID())) % 50); -- 1 a 50

        VALUES (
            @producto,
            @fecha,
            @id_tipo,
            @cantidad,
            CONCAT('Movimiento tipo ', @id_tipo, ' para producto ', @producto)
        );

        SET @mov = @mov + 1;
    END;

    SET @producto = @producto + 1;
END;

-- Encuesta.Satisfaccion → depende de Reserva.Reserva y Encuesta.Fuente
DECLARE @i INT = 1;

WHILE @i <= 75
BEGIN
    DECLARE @fecha DATETIME = DATEADD(DAY, ABS(CHECKSUM(NEWID())) % 365, '2024-01-01');
    DECLARE @puntaje INT = 1 + (ABS(CHECKSUM(NEWID())) % 10); -- 1 a 10
    DECLARE @id_fuente INT = 1 + (ABS(CHECKSUM(NEWID())) % 10); -- 1 a 10

    DECLARE @comentario NVARCHAR(500) = 
        CASE 
            WHEN @puntaje >= 9 THEN 'Servicio excelente.'
            WHEN @puntaje >= 7 THEN 'Buena atención.'
            WHEN @puntaje >= 5 THEN 'Aceptable, se puede mejorar.'
            ELSE 'No cumplió con las expectativas.'
        END;

    VALUES (@i, @fecha, @puntaje, @comentario, @id_fuente);

    SET @i = @i + 1;
END;

